//Burrito_Net\project_frontend\src\App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Auth/Login';
import Signup from './components/Auth/SignUp';
import ForgotPassword from './components/Auth/ForgotPassword'; // Nueva ruta
import Dashboard from './components/Dashboard';
import CreateProject from './components/Project/CreateProject';
import ProjectDetail from './components/Project/ProjectDetail'; // Nueva ruta
import ProjectList from './components/Project/ProjectList'; // Nueva ruta
import EditProfile from './components/User/EditProfile'; // Nueva ruta
import UserProfile from './components/User/UserProfile'; // Nueva ruta

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/forgot-password" element={<ForgotPassword />} /> {/* Nueva ruta */}
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/createproject" element={<CreateProject />} />
        <Route path="/projects/:id" element={<ProjectDetail />} /> {/* Nueva ruta */}
        <Route path="/projects" element={<ProjectList />} /> {/* Nueva ruta */}
        <Route path="/profile/edit" element={<EditProfile />} /> {/* Nueva ruta */}
        <Route path="/profile" element={<UserProfile />} /> {/* Nueva ruta */}
      </Routes>
    </Router>
  );
};

export default App;
